import React from 'react';
import SideBar from "./sidebar";
import logo from "../assets/fusion_logo.png";

function Header(){
    return (
        <div>
        <SideBar pageWrapId={"page-wrap"} outerContainerId={"App"} />

        <div class = "Header">
            <img src={logo} alt="Logo" />;
            <h1>confusion</h1>

        </div>
        </div>
    )
}

export default Header
